import React from 'react';

const Header: React.FC = () => {
    const [isScrolled, setIsScrolled] = React.useState(false);
    const [activeSection, setActiveSection] = React.useState('about');

    React.useEffect(() => {
        const handleScroll = () => {
            setIsScrolled(window.scrollY > 50);
        };
        window.addEventListener('scroll', handleScroll);
        return () => window.removeEventListener('scroll', handleScroll);
    }, []);

    return (
        <>
            <style>
                {`
                    @keyframes slideDown {
                        from {
                            opacity: 0;
                            transform: translateY(-20px);
                        }
                        to {
                            opacity: 1;
                            transform: translateY(0);
                        }
                    }

                    .slide-down {
                        animation: slideDown 0.6s ease-out forwards;
                    }
                `}
            </style>

            <header
                style={{
                    position: 'fixed',
                    top: 0,
                    left: 0,
                    right: 0,
                    background: isScrolled
                        ? 'rgba(255, 255, 255, 0.95)'
                        : 'rgba(255, 255, 255, 0.9)',
                    backdropFilter: 'blur(20px)',
                    borderBottom: isScrolled
                        ? '1px solid rgba(59, 130, 246, 0.2)'
                        : '1px solid rgba(226, 232, 240, 0.3)',
                    boxShadow: isScrolled
                        ? '0 8px 32px rgba(0, 0, 0, 0.12)'
                        : '0 4px 16px rgba(0, 0, 0, 0.06)',
                    padding: isScrolled ? '0.8rem 2rem' : '1.2rem 2rem',
                    transition: 'all 0.4s cubic-bezier(0.4, 0, 0.2, 1)',
                    zIndex: 1000
                }}
                className="slide-down"
            >
                <div
                    style={{
                        display: 'flex',
                        justifyContent: 'space-between',
                        alignItems: 'center',
                        maxWidth: '1200px',
                        margin: '0 auto'
                    }}
                >
                    {/* Logo/Title */}
                    <h1
                        style={{
                            background: 'linear-gradient(135deg, #2563eb 0%, #1d4ed8 50%, #1e40af 100%)',
                            WebkitBackgroundClip: 'text',
                            WebkitTextFillColor: 'transparent',
                            fontSize: isScrolled ? '1.8rem' : '2.2rem',
                            fontWeight: '800',
                            letterSpacing: '-0.02em',
                            transition: 'font-size 0.4s ease',
                            margin: 0,
                            cursor: 'pointer'
                        }}
                        onMouseEnter={(e) => {
                            e.currentTarget.style.transform = 'scale(1.05)';
                        }}
                        onMouseLeave={(e) => {
                            e.currentTarget.style.transform = 'scale(1)';
                        }}
                    >
                        Mohith's Portfolio
                    </h1>

                    {/* Navigation */}
                    <nav>
                        <ul
                            style={{
                                display: 'flex',
                                listStyle: 'none',
                                gap: '1.5rem',
                                margin: 0,
                                padding: 0,
                                alignItems: 'center'
                            }}
                        >
                            {[
                                { href: '#about', label: 'About Me' },
                                { href: '#education', label: 'Education' },
                                { href: '#skills', label: 'Skills' },
                                { href: '#projects', label: 'Projects' },
                                { href: '#achievements', label: 'Achievements' },
                                // { href: '#contact', label: 'Contact' }
                            ].map((item, index) => (
                                <li
                                    key={item.href}
                                    style={{
                                        opacity: 0,
                                        animation: `slideDown 0.6s ease-out ${0.2 + index * 0.1}s forwards`
                                    }}
                                >
                                    <a
                                        href={item.href}
                                        style={{
                                            color: activeSection === item.href.slice(1)
                                                ? '#2563eb'
                                                : '#475569',
                                            textDecoration: 'none',
                                            fontWeight: '600',
                                            fontSize: '0.95rem',
                                            padding: '0.4rem 0.8rem',
                                            borderRadius: '8px',
                                            background:
                                                activeSection === item.href.slice(1)
                                                    ? 'rgba(59, 130, 246, 0.1)'
                                                    : 'transparent',
                                            border:
                                                activeSection === item.href.slice(1)
                                                    ? '1px solid rgba(59, 130, 246, 0.2)'
                                                    : '1px solid transparent',
                                            transition: 'all 0.3s cubic-bezier(0.4, 0, 0.2, 1)',
                                            position: 'relative',
                                            display: 'block'
                                        }}
                                        onMouseEnter={(e) => {
                                            if (activeSection !== item.href.slice(1)) {
                                                e.currentTarget.style.color = '#2563eb';
                                                e.currentTarget.style.background = 'rgba(59, 130, 246, 0.08)';
                                                e.currentTarget.style.transform = 'translateY(-2px)';
                                                e.currentTarget.style.boxShadow =
                                                    '0 4px 12px rgba(59, 130, 246, 0.15)';
                                            }
                                        }}
                                        onMouseLeave={(e) => {
                                            if (activeSection !== item.href.slice(1)) {
                                                e.currentTarget.style.color = '#475569';
                                                e.currentTarget.style.background = 'transparent';
                                                e.currentTarget.style.transform = 'translateY(0)';
                                                e.currentTarget.style.boxShadow = 'none';
                                            }
                                        }}
                                        onClick={() => setActiveSection(item.href.slice(1))}
                                    >
                                        {item.label}
                                    </a>
                                </li>
                            ))}
                        </ul>
                    </nav>
                </div>
            </header>

            {/* Spacer to prevent content from hiding behind fixed header */}
            <div
                style={{
                    height: isScrolled ? '80px' : '100px',
                    transition: 'height 0.4s ease'
                }}
            ></div>
        </>
    );
};

export default Header;
